水切りそうじっこ 排水口三角コーナー兼用 不織布タイプ 20枚入<br><br>取り付け簡単でヌメリを抑える水切り袋です。<br>ゴム付きギャザーで取り付けが簡単。<br>不織布タイプなので、水切れがよく、細かいゴミまで取れ、油分を吸着し、ヌメリを抑えます。<br>排水口・三角コーナー兼用。<br><br>内容量：20枚入<br>サイズ(外形寸法)：32*22(cm)<br><br>JAN:4978406013343<p>原料樹脂 :ポリプロピレン </p><p>耐熱温度 :120度 </p><p>使用上の注意 <br>●カレー、シチューなど油分を多く含んだものを一度に流さないでください。目詰まりします。 <br>●耐熱温度を超えたものは流さないでください。 <br>●突起物のあるものを入れると、破れることがありますので、ご注意ください。 <br>●寒冷地でのご使用は、破れの原因となることがあります。 <br>●あまり強く引っ張らないでください。 <br>●水切り袋以外の用途には、ご使用にならないでください。 </p><br><br>CS：192<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
